import React, { useState } from 'react';
import logo from '../src/images/Vector-Smart-Object11.png';
import './header.css';
import { Link } from 'react-router-dom';

function Header() {
  const [activeLink, setActiveLink] = useState('HOME');

  function handleNavLinkClick(linkText) {
    setActiveLink(linkText);
  }

  return (
    <div className='navbar'>
      <div className='logo'>
        <img src={logo} className='image-logo' alt='' />
      </div>
      <div className='nav-text'>
        <Link className='link-header' to='/' onClick={() => handleNavLinkClick('HOME')}>
          <p
            style={{ WebkitTextFillColor: activeLink === 'HOME' ? 'white' : '' }}
            className='navtexts'
          >
            HOME
          </p>
        </Link>
        <Link className='link-header' to='/aboutus' onClick={() => handleNavLinkClick('ABOUT')}>
          <p
            style={{ WebkitTextFillColor: activeLink === 'ABOUT' ? 'white' : '' }}
            className='navtexts'
          >
            ABOUT
          </p>
        </Link>
        <Link className='link-header' to='/services' onClick={() => handleNavLinkClick('SERVICES')}>
          <p
            style={{ WebkitTextFillColor: activeLink === 'SERVICES' ? 'white' : '' }}
            className='navtexts'
          >
            SERVICES
          </p>
        </Link>
        <Link className='link-header' to='/contactus' onClick={() => handleNavLinkClick('CONTACT')}>
          <p
            style={{ WebkitTextFillColor: activeLink === 'CONTACT' ? 'white' : '' }}
            className='navtexts'
          >
            CONTACT US
          </p>
        </Link>
      </div>
    </div>
  );
}

export default Header;






















































